a.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"1f3b328d-f796-4ff1-91e1-8c217c9c4c01","type":"CustomJS"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_scroll":"auto","active_tap":"auto","tools":[{"id":"82b44514-a5db-44c0-9ea0-70469a0363ba","type":"HoverTool"},{"id":"0ecc0dd6-aaab-4d58-9565-2bdf4381f384","type":"WheelZoomTool"},{"id":"92842d8f-043c-4416-8095-75fe2a50f21b","type":"PanTool"},{"id":"64099db9-20f6-4b49-bd41-1d636aa2edb2","type":"SaveTool"},{"id":"162329db-77c1-44e3-966f-8a56d223dbfe","type":"ResetTool"}]},"id":"76ca2783-0a4d-4b19-92a4-c55178b90be4","type":"Toolbar"},{"attributes":{},"id":"162329db-77c1-44e3-966f-8a56d223dbfe","type":"ResetTool"},{"attributes":{"callback":null},"id":"a3d37829-e5fd-4645-881f-b6faeafcaaad","type":"DataRange1d"},{"attributes":{"callback":null},"id":"77302a0d-125d-447d-bf0c-728fa9772d46","type":"DataRange1d"},{"attributes":{"below":[{"id":"f0647264-f18b-42e0-8df6-d7b
